import React from "react";
import "./EditList_ul.css";

function EditList_ul(props) {
  const { editList_Ul, className } = props;

  return (
    <div className={`edit-listul ${className || ""}`}>
      <img className="edit-listul-1" src={editList_Ul} />
    </div>
  );
}

export default EditList_ul;
